import React from "react";

class Android extends React.Component {
    render() {
        return (
            <>
                 <h1 className="middle">Android</h1>
                <main className="grid" style={{paddingLeft: "2%", paddingRight: "2%"}}>
                    <div onClick={() => window.location += "/nimgameapp"} className="grid-around-space">
                        <span className="middle">NimmGameApp</span>
                        <img  alt="" src="https://raw.githubusercontent.com/SillyGoose123/NimmGameApp/main/app/src/main/res/mipmap-xhdpi/ic_launcher.png"/>
                        <motion.button
                        className="btngreenDev"
                        whileHover={{ scale: 1.1 }}
                        whileTap={{ scale: 0.9 }}
                        style={{ color: "", fontSize: 20, position: "absolute", bottom: "2%"}}
                        onClick={() => window.location = "/"}
                        >
                        Go Home
                        </motion.button>
                    </div>
                </main>      
            </>
        )
    }
}

export default Android;
